import cvData from "../../db/cvData";
import SectionCV from "../SectionCV";

const SectionsCV = () => {
  return (
    <ul>
      {cvData.map((title, content, image) => {
        return <SectionCV title={title} content={content} image={image} />;
      })}
    </ul>
  );
};
export default SectionsCV;
